import React,{Component} from "react";
import { render } from "react-dom";
import { useState } from "react";
import axios from "axios"
export default class Getzip extends Component{
    
    constructor(props){
        super(props)

        this.state = {
            zipData:[]
        }
    }

    getdata(e){
        e.preventDefault()
        console.log("test")
        axios(`http://ctp-zip-api.herokuapp.com/zip/10305`)
        .then(Response => {this.setState({zipData: Response.data})})
        .then(data => this.state.zipData = data)
    }
    render(){
        return(<>
        <div>
          <div>
            <input type = 'text'></input>
            <button onSubmit={this.getdata}>Submit</button>
          </div>
            <div>{this.state.zipData.City}</div>
                
           
        </div>
        
        
        
        </>)
            
        
        

        
    }
        
        
}
